const Card = (props) =>{
	const {name,email,id} = props;
	return(
		<div className='bg-blue dib br3 pa4 ma2 grow baskerville { font-family: baskerville, serif; } 
		yellow { color: var(--yellow); } b--dashed { border-style: dashed; }'>
		 <img src={'https://robohash.org/${props.id}?size=100x100'} alt='Robo'/>
		 <div>
		  <h2>{props.name}</h2>
		  <p>{props.email}</p>
		 </div>
		</div>
		);
}
export default Card;
